function [CE] = EstimateEssentialMatrix2(Cx)
%ESTIMATEESSENTIALMATRIX Summary of this function goes here
%   Detailed explanation goes here
if length(Cx) ~= 5
    error('Exactly 5 points required for Fundamental Matrix estimation')
end
x = cell2mat(Cx);
x1 = x(1:2,:);
x2 = x(3:4,:);

Es = fivePointAlgorithm(cat(3, Homogenize(x1)', Homogenize(x2)'));
CE = cellfun(@(E) E/norm(E)*sqrt(2)/2, Es(:)', 'UniformOutput', false);
end

% The following are excerpts from "estimateEssentialMatrix.m"
%--------------------------------------------------------------------------
function Es = fivePointAlgorithm(x, varargin)
Q1 = x(:,:,1);
Q2 = x(:,:,2);

Q = [Q2(:,1).*Q1(:,1),...
    Q2(:,1).*Q1(:,2),...
    Q2(:,1).*Q1(:,3),...
    Q2(:,2).*Q1(:,1),...
    Q2(:,2).*Q1(:,2),...
    Q2(:,2).*Q1(:,3),...
    Q2(:,3).*Q1(:,1),...
    Q2(:,3).*Q1(:,2),...
    Q2(:,3).*Q1(:,3),...
    ];

[~, ~, V] = svd(Q);
EE = V(:,6:9);
E1 = reshape(EE(:,1), [3,3])';
E2 = reshape(EE(:,2), [3,3])';
E3 = reshape(EE(:,3), [3,3])';
E4 = reshape(EE(:,4), [3,3])';

C = computeCoefficients(E1, E2, E3, E4);

C1 = C(:,[1:4,11:13,17:18,20]);
C2 = [zeros(10,4, 'like', C) C(:,[5:7,14:15,19])];
C3 = [zeros(10,7, 'like', C) C(:,[8:9,16])];
C4 = [zeros(10,9, 'like', C) C(:,10)];

Es = polyeig4(C1,C2,C3,C4,E1,E2,E3,E4);
end

