            Em(:,:,k) = E;            
        end
    end    
end

% Convert to cell array, because this is what msac expects.
if isempty(coder.target)
    Es = num2cell(Em(:,:,1:k), [1 2]);
else
    Es = repmat({zeros(3, 'like', Em)}, [1, k]);
    for i = 1:k
        Es{i} = Em(:,:,i);
    end
end
end